import './App.css';
import Header from './components/Header';
import Navbar from './components/Nav';
import Home from './components/Home';
import Works from './components/Works';
import Services from './components/Services';
import Contact from './components/Contact';
import Footer from './components/Footer';

import BoltIcon from '@mui/icons-material/Bolt';

import React, { useState, useEffect } from 'react';
import HomeRoundedIcon from '@mui/icons-material/HomeRounded';
import SourceRoundedIcon from '@mui/icons-material/SourceRounded';
import IntegrationInstructionsRoundedIcon from '@mui/icons-material/IntegrationInstructionsRounded';
import RingVolumeRoundedIcon from '@mui/icons-material/RingVolumeRounded';

function App() {
  const [activeSection, setActiveSection] = useState('0');

  const scrollToSection = (id) => {
    const element = document.getElementById(id);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  useEffect(() => {
    const handleScroll = () => {
      const sections = ['0', '1', '2', '3'];
      const scrollPosition = window.scrollY + 200;
      for (const section of sections) {
        const currentSection = document.getElementById(section);
        if (currentSection && scrollPosition >= currentSection.offsetTop && scrollPosition < currentSection.offsetTop + currentSection.offsetHeight) {
          setActiveSection(section);
        }
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);


  const handleReload = () => {
    window.location.reload();
    window.scrollTo(0, 0);
  };

  return (
    <body className="scrollbar h-screen w-screen xl:px-60 lg:px-40 px-8 py-4 overflow-hidden bg-center">

      <div className='scrollbar bg-white/70 backdrop-blur-sm h-full overflow-y-scroll rounded-lg text-dark  drop-shadow-md border text-sm md:text-base'>
        <div className='w-full bg-accent rounded-t-lg text-center py-1 sticky top-0 z-50 text-xs'>
          <button onClick={handleReload} className='font-semibold '>BRING YOUR VISIONS TO LIFE</button>
          <span className='absolute right-1 top-0 flex items-center animate-pulse'>
            <BoltIcon className='pl-1 icon text-green-500' />
            <p className='pr-1 hidden md:block'>Available for Hire</p>
          </span>
        </div>

        <div>
          <Header />


          <nav className='backdrop-blur-md bg-accent/50 flex justify-center p-1 sticky top-6 md:text-sm text-xs font-semibold z-50 shadow'>
            <ul className='flex justify-between gap-10 md:gap-16 text-secondary'>

              <li className={`{activeSection === '0' ? 'active' : ''} hover:text-primary cursor-pointer`}>
                <button
                  onClick={() => scrollToSection('0')}
                  className={`${activeSection === '0' ? 'bg-pink-200' : 'bg-green-400'}`}
                >
                  <span className='w-full flex justify-center md:hidden'>
                    <HomeRoundedIcon />
                  </span>
                  Home
                </button>
              </li>

              <li className={activeSection === '1' ? 'active hover:text-slate-600 cursor-pointer' : 'hover:text-slate-600 cursor-pointer'}>
                <button
                  onClick={() => scrollToSection('1')}
                >
                  <span className='w-full flex justify-center md:hidden'>
                    <SourceRoundedIcon />
                  </span>
                  Services
                </button>
              </li>

              <li className={activeSection === '2' ? 'active hover:text-slate-600 cursor-pointer' : 'hover:text-slate-600 cursor-pointer'}>
                <button
                  onClick={() => scrollToSection('2')}
                >
                  <span className='w-full flex justify-center md:hidden'>
                    <IntegrationInstructionsRoundedIcon />
                  </span>
                  Projects
                </button>
              </li>

              <li className={activeSection === '3' ? 'active hover:text-slate-600 cursor-pointer' : 'hover:text-slate-600 cursor-pointer'}>
                <button
                  onClick={() => scrollToSection('3')}
                >
                  <span className='w-full flex justify-center md:hidden'>
                    <RingVolumeRoundedIcon />
                  </span>
                  Contact
                </button>
              </li>
            </ul>
          </nav>

          <div className=''>
            <section id='0' className='border-t border-bg2'>
              <Home />
            </section>

            <section id='1' className='border-t border-bg2'>
              <Services />
            </section>

            <section id='2' className='border-t border-bg2'>
              <Works />
            </section>

            <section id='3' className='border-t border-bg2'>
              <Contact />
            </section>

            <section className='border-t border-bg2'>
              <Footer />
            </section>

          </div>
        </div>
      </div>

    </body>
  );
}

export default App;
